module.exports = /*#__PURE__*/JSON.parse('{"science":[{"id":1,"quote":"Curiosity is the engine behind every scientific discovery.","author":"Unknown"},{"id":2,"quote":"Science grows by questioning what everyone else accepts.","author":"Unknown"},{"id":3,"quote":"Every experiment is a step toward understanding the universe.","author":"Unknown"},{"id":4,"quote":"The universe hides its secrets in patterns; science reveals them.","author":"Unknown"},{"id":5,"quote":"A single observation can reshape centuries of knowledge.","author":"Unknown"},{"id":6,"quote":"Great scientists never stop being students of nature.","author":"Unknown"},{"id":7,"quote":"Even the smallest discovery can shift the course of history.","author":"Unknown"},{"id":8,"quote":"Science advances by challenging the impossible.","author":"Unknown"},{"id":9,"quote":"Nature speaks in numbers; science learns to interpret them.","author":"Unknown"},{"id":10,"quote":"The beauty of science is that it remains true, whether or not you believe it.","author":"Unknown"},{"id":11,"quote":"Innovation begins with a hypothesis and a bold mind.","author":"Unknown"},{"id":12,"quote":"Knowledge expands when we dare to test the unknown.","author":"Unknown"},{"id":13,"quote":"A scientific mind never stops refining its questions.","author":"Unknown"},{"id":14,"quote":"Data is the most honest storyteller in science.","author":"Unknown"},{"id":15,"quote":"The pursuit of truth is the heart of all science.","author":"Unknown"},{"id":16,"quote":"Discovery often begins where certainty ends.","author":"Unknown"},{"id":17,"quote":"Observation is the first step toward understanding.","author":"Unknown"},{"id":18,"quote":"Science transforms curiosity into understanding.","author":"Unknown"},{"id":19,"quote":"There is elegance in every scientific equation.","author":"Unknown"},{"id":20,"quote":"Progress is built upon countless small scientific victories.","author":"Unknown"},{"id":21,"quote":"Every theory begins as a thought too bold for its time.","author":"Unknown"},{"id":22,"quote":"Science is humanitys way of decoding natures puzzles.","author":"Unknown"},{"id":23,"quote":"Behind every invention lies a moment of scientific wonder.","author":"Unknown"},{"id":24,"quote":"Questions fuel science more than answers do.","author":"Unknown"},{"id":25,"quote":"The unknown is not a barrier; it is an invitation.","author":"Unknown"},{"id":26,"quote":"Every scientist stands on the shoulders of centuries of inquiry.","author":"Unknown"},{"id":27,"quote":"Science is the poetry of reality expressed through logic.","author":"Unknown"},{"id":28,"quote":"Patterns are natures handwriting.","author":"Unknown"},{"id":29,"quote":"Scientific humility comes from realizing how much remains undiscovered.","author":"Unknown"},{"id":30,"quote":"The universe rewards persistent curiosity.","author":"Unknown"},{"id":31,"quote":"Science is a journey, not a destination.","author":"Unknown"},{"id":32,"quote":"A good scientist questions twice as much as they answer.","author":"Unknown"},{"id":33,"quote":"Discovery begins with the courage to be wrong.","author":"Unknown"},{"id":34,"quote":"Science thrives where imagination meets evidence.","author":"Unknown"},{"id":35,"quote":"The most powerful tool in science is a curious mind.","author":"Unknown"},{"id":36,"quote":"Evidence is the compass that guides scientific truth.","author":"Unknown"},{"id":37,"quote":"Science is the continuous rewriting of human understanding.","author":"Unknown"},{"id":38,"quote":"Hypotheses are ideas waiting to be proven right or wrong.","author":"Unknown"},{"id":39,"quote":"Behind every breakthrough lies a thousand experiments.","author":"Unknown"},{"id":40,"quote":"Science turns impossibilities into possibilities over time.","author":"Unknown"}],"motivation":[{"id":41,"quote":"Discipline turns dreams into achievements.","author":"Unknown"},{"id":42,"quote":"Every small step forward is progress.","author":"Unknown"},{"id":43,"quote":"Success begins with the decision to try.","author":"Unknown"},{"id":44,"quote":"Your future is created by what you do today, not tomorrow.","author":"Unknown"},{"id":45,"quote":"Growth happens when you leave your comfort zone.","author":"Unknown"},{"id":46,"quote":"Your only limit is the one you place on yourself.","author":"Unknown"},{"id":47,"quote":"Consistency beats intensity every time.","author":"Unknown"},{"id":48,"quote":"Big goals are achieved through small daily actions.","author":"Unknown"},{"id":49,"quote":"Your mindset determines your path.","author":"Unknown"},{"id":50,"quote":"Believe in your ability to improve.","author":"Unknown"},{"id":51,"quote":"Failure is a lesson disguised as a setback.","author":"Unknown"},{"id":52,"quote":"Be patient with yourself; progress takes time.","author":"Unknown"},{"id":53,"quote":"Success begins where excuses end.","author":"Unknown"},{"id":54,"quote":"Hard work compounds like interest.","author":"Unknown"},{"id":55,"quote":"Dream boldly, act consistently.","author":"Unknown"},{"id":56,"quote":"Effort today builds strength for tomorrow.","author":"Unknown"},{"id":57,"quote":"Don\'t stop until you\'re proud.","author":"Unknown"},{"id":58,"quote":"Motivation starts you; discipline keeps you going.","author":"Unknown"},{"id":59,"quote":"Every challenge is a chance to grow stronger.","author":"Unknown"},{"id":60,"quote":"Your journey is uniqueembrace it.","author":"Unknown"},{"id":61,"quote":"Progress is progress, no matter how slow.","author":"Unknown"},{"id":62,"quote":"You become powerful when you choose persistence.","author":"Unknown"},{"id":63,"quote":"Courage is the bridge between fear and success.","author":"Unknown"},{"id":64,"quote":"You owe it to yourself to keep going.","author":"Unknown"},{"id":65,"quote":"Your best self is built through effort, not luck.","author":"Unknown"},{"id":66,"quote":"The only impossible journey is the one you never begin.","author":"Unknown"},{"id":67,"quote":"Success favors those who show up every day.","author":"Unknown"},{"id":68,"quote":"One day or day oneyou decide.","author":"Unknown"},{"id":69,"quote":"Let your ambition be louder than your doubts.","author":"Unknown"},{"id":70,"quote":"Your goals don\'t work unless you do.","author":"Unknown"},{"id":71,"quote":"You grow when you challenge your limits.","author":"Unknown"},{"id":72,"quote":"Small progress adds up to big change.","author":"Unknown"},{"id":73,"quote":"Your dreams deserve your dedication.","author":"Unknown"},{"id":74,"quote":"Each day is a fresh startuse it well.","author":"Unknown"},{"id":75,"quote":"If you can\'t do big things today, do small things well.","author":"Unknown"},{"id":76,"quote":"The harder the climb, the stronger you become.","author":"Unknown"},{"id":77,"quote":"Be the person your future self will thank you for.","author":"Unknown"},{"id":78,"quote":"Act with purpose, not pressure.","author":"Unknown"},{"id":79,"quote":"Momentum builds success.","author":"Unknown"},{"id":80,"quote":"Great things take timekeep going.","author":"Unknown"}],"philosophy":[{"id":81,"quote":"Wisdom begins with questioning your own assumptions.","author":"Unknown"},{"id":82,"quote":"A peaceful mind is the greatest form of wealth.","author":"Unknown"},{"id":83,"quote":"Your perception shapes your reality.","author":"Unknown"},{"id":84,"quote":"The meaning of life is often found in the moments we overlook.","author":"Unknown"},{"id":85,"quote":"Happiness grows when we let go of things we cannot control.","author":"Unknown"},{"id":86,"quote":"Perspective determines how we experience the world.","author":"Unknown"},{"id":87,"quote":"The mind is both the prison and the key.","author":"Unknown"},{"id":88,"quote":"Time reveals what words cannot.","author":"Unknown"},{"id":89,"quote":"Life becomes simpler when we stop trying to control everything.","author":"Unknown"},{"id":90,"quote":"You discover yourself in moments of silence.","author":"Unknown"},{"id":91,"quote":"A wise person listens more than they speak.","author":"Unknown"},{"id":92,"quote":"True peace comes from accepting the present fully.","author":"Unknown"},{"id":93,"quote":"Understanding others begins with understanding yourself.","author":"Unknown"},{"id":94,"quote":"Life teaches through both joy and suffering.","author":"Unknown"},{"id":95,"quote":"A calm mind sees truth clearly.","author":"Unknown"},{"id":96,"quote":"There is wisdom hidden in every experience.","author":"Unknown"},{"id":97,"quote":"We become wiser by observing, not just reacting.","author":"Unknown"},{"id":98,"quote":"Your inner world shapes your outer world.","author":"Unknown"},{"id":99,"quote":"The more you learn, the less you cling to certainty.","author":"Unknown"},{"id":100,"quote":"Life unfolds in the direction of your attention.","author":"Unknown"},{"id":101,"quote":"Letting go is a form of strength.","author":"Unknown"},{"id":102,"quote":"The search for truth begins with the courage to doubt.","author":"Unknown"},{"id":103,"quote":"Humility opens the door to wisdom.","author":"Unknown"},{"id":104,"quote":"Your values define your path.","author":"Unknown"},{"id":105,"quote":"To understand life, observe your thoughts.","author":"Unknown"},{"id":106,"quote":"A balanced life requires saying no as much as saying yes.","author":"Unknown"},{"id":107,"quote":"Stillness allows truth to surface.","author":"Unknown"},{"id":108,"quote":"The wisest decisions come from clarity, not impulse.","author":"Unknown"},{"id":109,"quote":"Your beliefs shape the limits of your world.","author":"Unknown"},{"id":110,"quote":"Perspective changes everything.","author":"Unknown"},{"id":111,"quote":"Learn to be comfortable with not knowing.","author":"Unknown"},{"id":112,"quote":"Truth is often simple, but rarely easy.","author":"Unknown"},{"id":113,"quote":"Deep thinking leads to deep understanding.","author":"Unknown"},{"id":114,"quote":"Let your actions reflect your principles.","author":"Unknown"},{"id":115,"quote":"Life becomes lighter when we detach from expectations.","author":"Unknown"},{"id":116,"quote":"The mind becomes free when it stops resisting reality.","author":"Unknown"},{"id":117,"quote":"Simplicity is a form of wisdom.","author":"Unknown"},{"id":118,"quote":"Reflection turns experience into insight.","author":"Unknown"},{"id":119,"quote":"The goal of philosophy is clarity, not answers.","author":"Unknown"},{"id":120,"quote":"Meaning is created, not discovered.","author":"Unknown"}],"humor":[{"id":121,"quote":"Im not lazy; Im on energy-saving mode.","author":"Unknown"},{"id":122,"quote":"I didnt oversleepmy bed kidnapped me.","author":"Unknown"},{"id":123,"quote":"I follow a seafood dietI see food and I eat it.","author":"Unknown"},{"id":124,"quote":"My patience is like my phone batteryalways running low.","author":"Unknown"},{"id":125,"quote":"I used to be indecisive, but now Im not so sure.","author":"Unknown"},{"id":126,"quote":"If stress burned calories, Id be invisible.","author":"Unknown"},{"id":127,"quote":"My brain has too many tabs open.","author":"Unknown"},{"id":128,"quote":"I\'m multitasking: I can waste time, be unproductive, and procrastinate all at once.","author":"Unknown"},{"id":129,"quote":"Common sense is like deodorantthose who need it most never use it.","author":"Unknown"},{"id":130,"quote":"Exercise? I thought you said \'extra fries\'.","author":"Unknown"},{"id":131,"quote":"Im not weird; Im limited edition.","author":"Unknown"},{"id":132,"quote":"My mood depends on how good my hair looks.","author":"Unknown"},{"id":133,"quote":"I\'m not late; I run on my own timezone.","author":"Unknown"},{"id":134,"quote":"I dont tripI do random gravity checks.","author":"Unknown"},{"id":135,"quote":"I speak fluent sarcasm.","author":"Unknown"},{"id":136,"quote":"Some people need a high-five. In the face. With a chair.","author":"Unknown"},{"id":137,"quote":"Why be moody when you can shake your booty?","author":"Unknown"},{"id":138,"quote":"Im in shape. Unfortunately, that shape is a potato.","author":"Unknown"},{"id":139,"quote":"My bed and I are perfect for each other, but my alarm clock keeps trying to break us up.","author":"Unknown"},{"id":140,"quote":"If Monday had a face, I would punch it.","author":"Unknown"},{"id":141,"quote":"I woke up early today. Or as most people call it: late.","author":"Unknown"},{"id":142,"quote":"Reality called, so I hung up.","author":"Unknown"},{"id":143,"quote":"My wallet is like an onionopening it makes me cry.","author":"Unknown"},{"id":144,"quote":"I dont need a hairstylist, my pillow gives me a new style every morning.","author":"Unknown"},{"id":145,"quote":"Running late counts as exercise, right?","author":"Unknown"},{"id":146,"quote":"I\'m not short, I\'m concentrated awesome.","author":"Unknown"},{"id":147,"quote":"Don\'t worry. I forgot what I was saying too.","author":"Unknown"},{"id":148,"quote":"I tried to be normal once. Worst two minutes of my life.","author":"Unknown"},{"id":149,"quote":"My brain: 1% useful thoughts, 99% random nonsense.","author":"Unknown"},{"id":150,"quote":"I\'m not clumsy; the floor just hates me.","author":"Unknown"},{"id":151,"quote":"Calories? I think you mean delicious points.","author":"Unknown"},{"id":152,"quote":"Im not arguing. Im just explaining why Im right.","author":"Unknown"},{"id":153,"quote":"If I were you, Id adore me.","author":"Unknown"},{"id":154,"quote":"I put the pro in procrastination.","author":"Unknown"},{"id":155,"quote":"I need a six-month vacation twice a year.","author":"Unknown"},{"id":156,"quote":"If Im late, its because I didnt want to come.","author":"Unknown"},{"id":157,"quote":"Life is short. Smile while you still have teeth.","author":"Unknown"},{"id":158,"quote":"My superpower is doing nothing for hours.","author":"Unknown"},{"id":159,"quote":"I whisper what the hell to myself at least twenty times a day.","author":"Unknown"},{"id":160,"quote":"I need a pause button for life and maybe a rewind.","author":"Unknown"}],"life":[{"id":161,"quote":"Life is a collection of momentsmake them meaningful.","author":"Unknown"},{"id":162,"quote":"The more you appreciate, the more life gives you to appreciate.","author":"Unknown"},{"id":163,"quote":"Life becomes lighter when you stop carrying unnecessary burdens.","author":"Unknown"},{"id":164,"quote":"Time passes whether you use it or waste itchoose wisely.","author":"Unknown"},{"id":165,"quote":"Life teaches you through both blessings and lessons.","author":"Unknown"},{"id":166,"quote":"What you focus on growschoose your thoughts carefully.","author":"Unknown"},{"id":167,"quote":"Life is simple; we complicate it with expectations.","author":"Unknown"},{"id":168,"quote":"Letting go is an act of love toward yourself.","author":"Unknown"},{"id":169,"quote":"The best things in life aren\'t things.","author":"Unknown"},{"id":170,"quote":"Life moves forwarddont get stuck replaying old chapters.","author":"Unknown"},{"id":171,"quote":"You only truly live when you embrace the present moment.","author":"Unknown"},{"id":172,"quote":"Life rewards those who remain patient and persistent.","author":"Unknown"},{"id":173,"quote":"Your life is shaped by the choices you make daily.","author":"Unknown"},{"id":174,"quote":"Growth starts the moment you stop avoiding discomfort.","author":"Unknown"},{"id":175,"quote":"Life becomes clearer when you simplify your priorities.","author":"Unknown"},{"id":176,"quote":"Enjoy the little thingsthey make up most of life.","author":"Unknown"},{"id":177,"quote":"Life is too short to stay in the wrong place with the wrong people.","author":"Unknown"},{"id":178,"quote":"Peace comes when you stop wishing for a different past.","author":"Unknown"},{"id":179,"quote":"Life is about balancework, rest, joy, and growth.","author":"Unknown"},{"id":180,"quote":"Trust the process; life unfolds at the right time.","author":"Unknown"},{"id":181,"quote":"The quality of your thoughts determines the quality of your life.","author":"Unknown"},{"id":182,"quote":"Life is lived fully when you appreciate small victories.","author":"Unknown"},{"id":183,"quote":"Growth comes from embracing change, not resisting it.","author":"Unknown"},{"id":184,"quote":"Life is always teaching; stay open to learning.","author":"Unknown"},{"id":185,"quote":"Live authenticallyyou\'re not here to impress anyone.","author":"Unknown"},{"id":186,"quote":"Life isn\'t about being perfect; it\'s about being real.","author":"Unknown"},{"id":187,"quote":"You can start over anytimelife allows infinite restarts.","author":"Unknown"},{"id":188,"quote":"What you appreciate becomes more meaningful.","author":"Unknown"},{"id":189,"quote":"Life becomes lighter when you stop comparing yourself.","author":"Unknown"},{"id":190,"quote":"Every day is a new chance to grow and improve.","author":"Unknown"},{"id":191,"quote":"Let life surprise yougood things often come unexpectedly.","author":"Unknown"},{"id":192,"quote":"Live less from habit and more from intention.","author":"Unknown"},{"id":193,"quote":"Life gives you what youre ready for, not what you wish for.","author":"Unknown"},{"id":194,"quote":"Be presentlife happens now, not later.","author":"Unknown"},{"id":195,"quote":"Your peace is more valuable than peoples opinions.","author":"Unknown"},{"id":196,"quote":"Life reflects the energy you bring into it.","author":"Unknown"},{"id":197,"quote":"Choose experiences over possessions.","author":"Unknown"},{"id":198,"quote":"Life isn\'t a race; it\'s a journey at your own pace.","author":"Unknown"},{"id":199,"quote":"Kindness enriches every moment of life.","author":"Unknown"},{"id":200,"quote":"Life becomes meaningful when you live it with intention.","author":"Unknown"}]}');

